      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE - 98 + + 33 NOT BETWEEN ( col2 * - - 8 ) AND col1 / + + 96 * + 35 * + - 76 + - col0 * - col2;
  - name: tab2

